  true,\n\t\"url\": null,\n\t\"notes\": \"The main objectives of the Safety Pilot
  Model Deployment (SPMD) include the exploration of the real-world effectiveness
  of connected vehicle safety applications in multi-modal driving conditions, the
  evaluation of how drivers adapted to the use of this connected vehicle technology,
  and the identification of potential safety benefits as a result of this connected
  vehicle technology. The SPMD - One Day Sample data environment contains sanitized
  mobility data elements that were collected from over 2700 vehicles, equipped with
  connected vehicle technologies, traversing Ann Arbor, MI. The data included in this
  data environment were generated on April 11, 2013. The mobility data provided in
  this environment is intended to support continued advancements in the connected
  vehicle domain as well as the development of applications to support improved transportation
  operation.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
